DROP TABLE IF EXISTS `partits`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `partits` (
  `partit_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT COMMENT 'PK de la taula, considerem 700 partits aprox. (7x100)',
  `tipus` enum('QUARTS','SEMIS','FINAL') NOT NULL,
  `competicio_id` tinyint(3) unsigned NOT NULL COMMENT 'Competició la qual pertany aquest partit',
  `data_hora` datetime NOT NULL COMMENT 'La data i hora del partit',
  `equip_local` smallint(5) unsigned NOT NULL COMMENT 'Id de la taula EQUIPS, representa l''equip local dins el partit',
  `equip_local_punts` tinyint(3) unsigned DEFAULT NULL COMMENT 'Punts de l''equip local, normalment inferiors a 100 punts',
  `equip_visitant` smallint(5) unsigned NOT NULL COMMENT 'Id de la taula EQUIPS, representa l''equip visitant dins el partit',
  `equip_visitant_punts` tinyint(3) unsigned DEFAULT NULL COMMENT 'Punts de l''equip visitant, normalment inferiors a 100 punts',
  PRIMARY KEY (`partit_id`),
  UNIQUE KEY `UK_PARITS_EQUIPS` (`equip_local`,`equip_visitant`),
  KEY `FK_PARTITS_COMPETICIONS` (`competicio_id`),
  KEY `FK_PARTITS_EVISITANT` (`equip_visitant`),
  CONSTRAINT `FK_PARTITS_COMPETICIONS` FOREIGN KEY (`competicio_id`) REFERENCES `competicions` (`competicio_id`),
  CONSTRAINT `FK_PARTITS_ELOCAL` FOREIGN KEY (`equip_local`) REFERENCES `equips_anys` (`equip_any_id`),
  CONSTRAINT `FK_PARTITS_EVISITANT` FOREIGN KEY (`equip_visitant`) REFERENCES `equips_anys` (`equip_any_id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

